import React from "react";
import ReactDOM from "react-dom/client";
import {
    BrowserRouter,
    Routes,
    Route,
  } from "react-router-dom";
import Login from "../Pages/Unlogged/Login";



const Router = () => {



    return(
        <BrowserRouter>
        <Routes>
        <Route path='/' element={<Login/>}/>
        </Routes>
        </BrowserRouter>
    )
}

export default Router;
